// src/pages/Home.js
import React from 'react';

function Home() {
  return (
    <div className="home">
      <h1>Bienvenido a SUNSUCA</h1>
      <p>Ofrecemos soluciones de sembrado ecológico, riego automático, y cuidado del medio ambiente.</p>
    </div>
  );
}

export default Home;
